@steveroach81 @sentientbeerhat @CateSJewels I'm a very cautious &amp; defensive driver, both in my car &amp; my truck.

I do my best to be courteous &amp; safe while driving, even when I'm in the right &amp; another car is in the wrong.

At the end of the day I just don't want to hurt myself or anyone else.

@steveroach81 @sentientbeerhat @CateSJewels I mean, that's exactly the mindset I mean.  Normal trucks weigh up to 80k pounds.

They can't speed up &amp; stop on a dime, &amp; need way more space to turn.

You &amp; everyone around you will be safer for it if you are more conscious of that when you drive around trucks.

@steveroach81 @sentientbeerhat @CateSJewels It's in your best interest to learn to drive safely around trucks.

I'm sure you've come across bad truckers, but you'd be surprised how many car drivers drive wrong around trucks, thinking they're in the right.

Anyway, drive safe out there.

@steveroach81 @sentientbeerhat @CateSJewels We're decades from having real self-driving trucks.

Right now, most trucks already have lane monitors, automatic braking, &amp; blind spot alerts.

The self driving trucks are the same tech but they keep the wheel straight on an open highway, with a driver for everything else.

